import styles from "./Footer.module.scss";

export const Footer = () => {
    return (
        <footer className="container">
            <div className={styles.column}>
                <h4>Приложение унистрой</h4>
                
                <a href="http://qrcoder.ru" target="_blank" id={styles.qr_code}>
                    <img src="http://qrcoder.ru/code/?https%3A%2F%2Fyoutu.be%2FdQw4w9WgXcQ%3Fsi%3DJMQ7__BpQ3uI-6xV&4&0" />
                </a>

            </div>
            <div className={styles.column}></div>
            <div className={styles.column}></div>
            <div className={styles.column}></div>
            <div className={styles.column}></div>
        </footer>
    );
};
